// src/renderer/shapes/powerline.ts
function drawPowerline(cp, x, y, cellW, cellH, color, out) {
  if (!isPowerline(cp))
    return false;
  const w = cellW;
  const h = cellH;
  const steps = Math.max(2, Math.round(Math.max(w, h)));
  const drawTriangle = (mode) => {
    for (let i = 0;i < steps; i += 1) {
      const t = steps === 1 ? 0 : i / (steps - 1);
      const py = y + t * h;
      let x0 = x;
      let x1 = x + w;
      if (mode === "right") {
        const span = w * (1 - Math.abs(t - 0.5) * 2);
        x1 = x + span;
      } else if (mode === "left") {
        const span = w * (1 - Math.abs(t - 0.5) * 2);
        x0 = x + (w - span);
      } else if (mode === "diag_ul_lr") {
        x1 = x + t * w;
      } else if (mode === "diag_ur_ll") {
        x0 = x + t * w;
      } else if (mode === "diag_ul_lr_inv") {
        x1 = x + (1 - t) * w;
      } else if (mode === "diag_ur_ll_inv") {
        x0 = x + (1 - t) * w;
      }
      pushRectSnapped(out, x0, py, Math.max(1, x1 - x0), 1, color);
    }
  };
  switch (cp) {
    case 57520:
      drawTriangle("right");
      return true;
    case 57522:
      drawTriangle("left");
      return true;
    case 57528:
      drawTriangle("diag_ul_lr");
      return true;
    case 57530:
      drawTriangle("diag_ur_ll");
      return true;
    case 57532:
      drawTriangle("diag_ul_lr_inv");
      return true;
    case 57534:
      drawTriangle("diag_ur_ll_inv");
      return true;
    case 57529:
    case 57531:
    case 57533:
    case 57535:
    case 57521:
    case 57523:
      drawTriangle(cp === 57529 || cp === 57535 ? "diag_ul_lr" : "diag_ur_ll");
      return true;
    default:
      return false;
  }
}

