    const canvas = getCanvas();
    const rect2 = canvas.getBoundingClientRect();
    const scaleX = rect2.width > 0 ? canvas.width / rect2.width : 1;
    const scaleY = rect2.height > 0 ? canvas.height / rect2.height : 1;
